<script setup>
import { router } from '@inertiajs/vue3';
import { computed } from 'vue';

const props = defineProps({
  size: String,
});

const classes = computed(() => {
  return props.size === 'small' ? 'w-12 h-12' : 'w-24 h-24';
});
</script>

<template>
  <a
    :href="'/'"
    @click="
      (event) => {
        event.preventDefault();
        router.get('/');
      }
    "
  >
    <svg :class="classes" viewBox="0 0 48 48" fill="none" xmlns="http://www.w3.org/2000/svg">
      <image
        width="48"
        height="48"
        xlink:href="data:image/png;base64,"
      />
    </svg>
  </a>
</template>
